<template>
  <div class="box active">
    <div class="box__wrap">
      <div class="box__top">
        <p class="box__id">#{{ item.id }}</p>
        <p class="box__market">
          {{ item.merchants[0].market.city.name }} -
          {{ item.merchants[0].market.title }}
        </p>
        <p v-if="item.updated_at == ''" class="box__date">
          {{ $moment(item.created_at).format('DD/MM') }}
          {{ $moment(item.created_at).format('HH:mm') }}
        </p>
        <p v-else class="box__date">
          {{ $moment(item.updated_at).format('DD/MM') }}
          {{ $moment(item.updated_at).format('HH:mm') }}
        </p>
        <a
          :class="[active ? 'active' : '']"
          class="box__open"
          @click="active = !active"
        >
          <svg
            width="16"
            height="10"
            viewBox="0 0 16 10"
            fill="none"
            xmlns="http://www.w3.org/2000/svg"
          >
            <path
              d="M15 9L8 1L1 9"
              stroke="#9A9A9A"
              stroke-width="1.5"
              stroke-linecap="round"
              stroke-linejoin="round"
            />
          </svg>
        </a>
      </div>
      <div class="box__bottom">
        <div :class="[!active ? 'active' : '']" class="box__small">
          <div>
            <span class="box__count">{{ item.products.length }} articles</span>
            <a class="box__tag">
              <svg
                width="16"
                height="12"
                viewBox="0 0 16 12"
                fill="none"
                xmlns="http://www.w3.org/2000/svg"
              >
                <path
                  d="M1 6.4L4.68421 10L15 1"
                  stroke="#1EC173"
                  stroke-width="1.5"
                  stroke-linecap="round"
                />
              </svg>
              <span>{{ statustranslate() }}</span>
            </a>
          </div>
          <p class="box__price">{{ $price(item.total) }}</p>
        </div>
        <div :class="[active ? 'active' : '']" class="box__big">
          <p class="box__merchant"></p>
          <!--          <p class="box__merchant">{{ item.merchant.title }}</p>-->
          <div class="box__product-items">
            <div
              v-for="(product, productIndex) in item.products"
              :key="productIndex"
              class="box__product-item"
            >
              <p class="box__quantity">x{{ product.pivot.quantity }}</p>
              <img class="box__image" :src="$api_storage_url + product.image" />
              <div class="box__product-wrap">
                <p class="box__product">{{ product.title }}</p>
                <p class="box__unit">
                  {{ product.unit_quantity }}
                  {{ product.unit.unit }}
                </p>
              </div>
              <p class="box__product-price">
                {{ $price(product.price * product.pivot.quantity) }}
              </p>
            </div>
          </div>
          <div class="box__info">
            <div class="box__info-left">
              <br />
              <p>Total</p>
            </div>
            <div class="box__info-right">
              <br />
              <h1>{{ $price(item.total) }}</h1>
            </div>
          </div>
          <div class="statuses">
            <p class="statuses__title">Suivi de la commande</p>
            <div class="statuses__wrap">
              <div class="statuses__left">
                <div
                  :class="[
                    status === 'IN_PROGRESS' ||
                    status === 'READY' ||
                    status === 'COMPLETED'
                      ? 'active'
                      : '',
                  ]"
                  class="statuses__circle"
                ></div>
                <div class="statuses__line"></div>
                <div
                  :class="[
                    status === 'READY' || status === 'COMPLETED'
                      ? 'active'
                      : '',
                  ]"
                  class="statuses__circle"
                ></div>
                <div class="statuses__line"></div>
                <div
                  :class="[status === 'COMPLETED' ? 'active' : '']"
                  class="statuses__circle"
                >
                  <!--                  <div class="statuses__active"></div>-->
                </div>
                <!--                <div class="statuses__line"></div>-->
                <!--                <div class="statuses__circle"></div>-->
              </div>
              <div class="statuses__right">
                <div class="statuses__column">
                  <a
                    :class="[
                      status === 'IN_PROGRESS' ||
                      status === 'READY' ||
                      status === 'COMPLETED'
                        ? 'statuses__tag'
                        : 'statuses__taglock',
                    ]"
                  >
                    <div
                      v-if="
                        status === 'IN_PROGRESS' ||
                        status === 'READY' ||
                        status === 'COMPLETED'
                      "
                      class="statuses__tag-icon-wrap"
                    >
                      <svg
                        width="16"
                        height="12"
                        viewBox="0 0 16 12"
                        fill="none"
                        xmlns="http://www.w3.org/2000/svg"
                      >
                        <path
                          d="M1 6.4L4.68421 10L15 1"
                          stroke="#1EC173"
                          stroke-width="1.5"
                          stroke-linecap="round"
                        />
                      </svg>
                    </div>
                    <div v-else class="statuses__tag-icon-wrap">
                      <svg
                        width="16"
                        height="12"
                        viewBox="0 0 16 12"
                        fill="none"
                        xmlns="http://www.w3.org/2000/svg"
                      >
                        <path
                          d="M1 6.4L4.68421 10L15 1"
                          stroke="white"
                          stroke-width="1.5"
                          stroke-linecap="round"
                        />
