<script>
export default {
  props: {
    item: {
      type: Object,
    },
  },
  data() {
    return {
      active: true,
    }
  },
  computed: {
    status() {
      return this.item.status
    },
    nextStatus() {
      if (this.item.status === 'PENDING') return 'IN_PROGRESS'
      else if (this.item.status === 'IN_PROGRESS') return 'READY'
      else return 'COMPLETED'
    },
    didIUpdateStatus() {
      if (this.item.status === 'COMPLETED') {
        return false
      } else if (this.item.status === 'READY') {
        return this.item.pivot.status === 'READY'
      } else if (this.item.status === 'IN_PROGRESS') {
        return this.item.pivot.status === 'IN_PROGRESS'
      }
      return this.item.pivot.status === 'PENDING'
    },
  },
  methods: {
    async update(status) {
      // this.status = status
      try {
        const res = await this.$axios.$put(`orders/${this.item.id}`, { status })
        this.$nuxt.$emit('order-status-changed')
        if (res.status === 'IN_PROGRESS') {
          // this.createPaymentIntent()
        }
      } catch (e) {
        this.errors.record(e.response.data.errors)
      }
    },
    createPaymentIntent() {
      this.loading = true
      this.$axios
        .post('stripe/payment-intent', { order_id: this.item.id })
        .then((res) => {
          this.confirmCardSetup(res.data.client_secret)
        })
        .catch((e) => {
          this.loading = false
          this.error = 'The given data was invalid'
          console.log(e.response.data.errors)
        })
    },
    statustranslate() {
      if (this.item.status === 'PENDING') {
        return 'En attente'
      }
      if (this.item.status === 'IN_PROGRESS') {
        return 'En pr√©paration'
      }
      if (this.item.status === 'READY') {
        return 'Pr√™t'
      }
      if (this.item.status === 'COMPLETED') {
        return 'Terminer'
      }
    },
  },
}
</script>

